import Vue from "vue";
import Router from "vue-router";
import Login from "./views/Login.vue";
import Create from "./views/Create/Create.vue";
import CreateThird from "./views/Create/CreateThird.vue";
import Restore from "./views/Restore/Restore.vue";
import Setting from "./views/Setting.vue";
import Home from "./views/Home/Home.vue";
import HomeContent from "@/views/HomeContent.vue";
import Shift from "./views/Shift.vue";
import Send from "./views/Sends/Send.vue";
import SendForm from "./views/Sends/SendForm.vue";
import SendFinish from "./views/Sends/SendFinish.vue";
import Receive from "./views/Receive.vue";
import Info from "./views/MyInfo.vue";

Vue.use(Router);

export default new Router({
  mode: "history",
  routes: [
    {
      path: "/",
      component: Login
    },
    {
      path: "/create",
      component: Create
    },
    {
      path: "/restore",
      component: Restore
    },
    {
      path: "/createthird",
      name: "createthird",
      component: CreateThird
    },
    {
      path: "/createsecond",
      component: () => import("./views/Create/CreateSecond.vue")
    },
    {
      path: "/home",
      meta: {
        requireLogin: true
      },
      component: Home,
      children: [
        {
          path: "/",
          meta: {
            requireLogin: true
          },
          component: HomeContent
        },
        {
          path: "home",
          meta: {
            requireLogin: true
          },
          component: HomeContent
        },
        {
          path: "shift",
          meta: {
            requireLogin: true
          },
          component: Shift
        },
        {
          path: "info",
          meta: {
            requireLogin: true
          },
          component: Info
        },
        {
          path: "setting",
          meta: {
            requireLogin: true
          },
          component: Setting
        },
        {
          path: "receive",
          meta: {
            requireLogin: true
          },
          component: Receive
        },
        {
          path: "send",
          meta: {
            requireLogin: true
          },
          component: Send,
          children: [
            {
              path: "/",
              meta: {
                requireLogin: true
              },
              component: SendForm
            },
            {
              path: "finish",
              meta: {
                requireLogin: true
              },
              component: SendFinish
            }
          ]
        }
      ]
    }
  ]
});
